  type t = int list

  (** val index : t -> int -> int **)

  let index l idx =
    match nth_error l (Z.to_nat (Int.unsigned idx)) with
    | Some i -> i
    | None -> Int64.zero

  (** val assign' : t -> int -> int -> t option **)

  let rec assign' l cur v =
    match l with
    | [] -> None
    | hd :: tl ->
      ((fun fO fS n -> if n=0 then fO () else fS (n-1))
         (fun _ -> Some (v :: tl))
         (fun n0 ->
         match assign' tl n0 v with
         | Some nl -> Some (hd :: nl)
         | None -> None)
